    const {id} = useParams();
    const getMovie = async () => {
        const response = await fetch(
            `https://yts.mx/api/v2/movie_details.json?movie_id=${id}`
        );
        const json = await response.json(); 
    };
    useEffect(()=>{
        getMovie();
    }, []);
    return (<h1>Detail</h1>);
}

export default Detail;
